import React from 'react';
import Idea from './Idea';

const IdeaList = ({ideas, deleteIdea, editIdea}) => {

  return (
    <div>
      {ideas && ideas.map((idea) => {
        return(

          <div className='box'>

        <Idea

          key={idea.id} 
          idea={idea} 
          deleteIdea={deleteIdea} 
          editIdea={editIdea}
          />
          </div>
        );
      })}
    </div>
  );
};

export default IdeaList;
